import React from 'react'
import styles from '../styles/AddForm.module.css'

function AddForm() {

  const submitHandler = e => {
    e.preventDefault()

  }
  return (
    <div className={styles.cardForm}>
      <form onSubmit={submitHandler}>
        <label>Team's Name:<input type="text"/></label><br/>
        <label>Team's City:<input type="text"/></label><br/>
        <label>Team's State:<input type="text"/></label><br/>
        <label>Team's Stadium:<input type="text"/></label><br/>
        <label>Team's Picture:<input type="text"/></label><br/>
        <button>Submit</button>
      </form>
    </div>
  )
}

export default AddForm
